export function Table({
  children,
  headerTitle,
}: {
  children?: any;
  headerTitle?: any;
}) {
  return (
    <View style={{ borderWidth: 1, borderColor: "#333" }}>
      <TableHeader title={headerTitle} />
      {children}
    </View>
  );
}
